import React from "react";
import { useParams } from "react-router-dom";

const DetailJob = (props) => {
  const { params } = props.match;
  let { p1 } = useParams();
  let { p2 } = useParams();
  return (
    <h3>
      ID: {p1}
      company name : {p2}
      <div>
        <b>Parameter 1: </b>
        {params.p1}
      </div>
      <div>
        <b>Parameter 2: </b>
        {params.p2}
      </div>
    </h3>
  );
};

export default DetailJob;
